import React from 'react';
import Student from './Student.css';

const studentTable = props => {
  return (
    <div>
      <h1 id="title">React Dynamic Table</h1>
      <table id="students">
        <tbody>
          <tr> {props.renderHeader}</tr>
          {props.renderBody}
        </tbody>
      </table>
    </div>
  );
};

export default studentTable;
